import Link from 'next/link';

const Main=()=>{
    return(
       <div className="main-section">
           <h1>Welcome, select your option:</h1>
           <div className="options-container">
               <Link href="/starships">
                   <img src="/static/starwarsstarships.jpg" alt="TIE-fighter image" className="options-image" />
               </Link>
               <Link href="/vehicles">
                   <img src="/static/starwarsvehicles.jpg" alt="hovering vehicle" className="options-image" />
               </Link>
           </div>
       </div>
    )
}

export default Main;
